  import React from 'react'
  import { MDXTag } from '@mdx-js/tag'


export default class MDXContent extends React.Component {
  constructor(props) {
    super(props)
    this.layout = null
  }
  render() {
    const { components, ...props } = this.props

    return <MDXTag
             name="wrapper"

             components={components}><MDXTag name="h1" components={components} props={{"id":"es6-fiddle"}}>{`ES6 Fiddle`}</MDXTag>
<MDXTag name="hr" components={components}></MDXTag>
<MDXTag name="h2" components={components} props={{"id":"map-function"}}>{`Map Function`}</MDXTag>
<MDXTag name="pre" components={components}><MDXTag name="code" components={components} parentName="pre" props={{}}>{`let doubles = [1,2,3,4].map(v => v+1);
console.log(doubles[0]); //2

let terms = ["Ben", "Den", "Sam"];
console.log(terms.map(name => \`I am \${name}\`));
// I am Ben, I am Den, I am Sam
`}</MDXTag></MDXTag>
<MDXTag name="h2" components={components} props={{"id":"arrow-function"}}>{`Arrow Function`}</MDXTag>
<MDXTag name="pre" components={components}><MDXTag name="code" components={components} parentName="pre" props={{}}>{`let nums = [1,2,3,4,5,6];
let fives = [];

nums.forEach(v => {
   if (v % 5 === 0)
       fives.push(v)
})

console.log(fives);
// print 5
`}</MDXTag></MDXTag>
<MDXTag name="h2" components={components} props={{"id":"rest-parameter"}}>{`Rest Parameter`}</MDXTag>
<MDXTag name="pre" components={components}><MDXTag name="code" components={components} parentName="pre" props={{}}>{`function f (x, y, ...a) {
    return (x + y) * a.length;
}
console.log(f(1, 2, "hello", true, 7) === 9);
// returns true
`}</MDXTag></MDXTag>
           </MDXTag>
  }
}
